import React from 'react';
import { Menu, Icon, Input, Typography } from 'antd';

const { Title, Paragraph, Text } = Typography;
const { Search } = Input;

const AppTopbar = () => {
    return(
        <div>
          <Menu mode="horizontal">
            <Menu.Item key="mail">
                <Icon type="home" />
            </Menu.Item>
            <Menu.Item key="search">
                <Search
                    placeholder="input search text"
                    enterButton="Search"
                    size="large"
                /> 
            </Menu.Item>
            <Menu.Item key="subject">
                <Typography>
                    <Title>RemindFeedBack</Title>
                </Typography>
            </Menu.Item>
            <Menu.Item key="bell">
                <Icon type="bell lg" />
            </Menu.Item>
          </Menu>  
        </div>
    );
};

export default AppTopbar;
